INSERT INTO `contents` VALUES (1, '2022-06-22 01:15:00', '2022-09-12 16:57:01', 'main_text', 'home', '<h1 class=\"font-bold text-4xl\">\r\n                    <span class=\"block\">Biz bilan hammasi oson.</span>\r\n                </h1>\r\n                <p class=\"mt-3 text-sm md:text-base sm:mt-5 sm:mx-auto md:mt-3 md:md:mt-2 mb-3\">\r\n                   Har qanaday vazifa uchun ishonchli bajaruvchi topishga yordam beramiz</p>', '<h1 class=\"font-bold text-4xl\">\r\n                    <span class=\"block\">С нами всё легко</span>\r\n                </h1>\r\n                <p class=\"mt-3 text-sm md:text-base sm:mt-5 sm:mx-auto md:mt-3 md:md:mt-2 mb-3\">\r\n                    Поможем найти надежного исполнителя для любой задачи\r\n                </p>', '');
INSERT INTO `contents` VALUES (2, '2022-06-22 01:29:00', '2022-07-26 18:15:47', 'blogs_first', 'home', '<div class=\"sm:rounded-r-2xl rounded-r-2xl-none sm:rounded-none rounded-2xl sm:w-2/3 w-full p-3 shadow-md\">\r\n            <h1 class=\"text-lg text-gray-700 font-bold\">Qulay va ishonchli to\'lov turlari</h1>\r\n            <p class=\"text-sm text-gray-600\">Hisobingizni Click,Payme va Paynet orqali to\'ldiring</p>\r\n        </div>', '<div class=\"sm:rounded-r-2xl rounded-r-2xl-none sm:rounded-none rounded-2xl sm:w-2/3 w-full p-3 shadow-md\">\r\n            <h1 class=\"text-lg text-gray-700 font-bold\">Удобная и надежная оплата</h1>\r\n            <p class=\"text-sm text-gray-600\">Пополняйте счет через Click, Pamye и Paynet</p>\r\n        </div>', 'contents\\July2022\\LJe2zNzUzBEbKlMCfRRL.png');
INSERT INTO `contents` VALUES (3, '2022-06-22 01:32:00', '2022-08-02 16:54:28', 'blogs_second', 'home', '<div class=\"sm:rounded-r-2xl rounded-r-2xl-none sm:rounded-none rounded-2xl sm:w-2/3 w-full p-3 shadow-md\">\r\n            <h1 class=\"text-lg text-gray-700 font-bold\">Ishonchli ijrochilar</h1>\r\n            <p class=\"text-sm text-gray-600\">Siz UserUz orqali telefon nomerlari va elektron pochtalari tasqdiqlangan ishonchli bajaruvchilar topishingiz mumkin.</p>\r\n        </div>', '<div class=\"sm:rounded-r-2xl rounded-r-2xl-none sm:rounded-none rounded-2xl sm:w-2/3 w-full p-3 shadow-md\">\r\n            <h1 class=\"text-lg text-gray-700 font-bold\">Надежные исполнители</h1>\r\n            <p class=\"text-sm text-gray-600\">Вы можете найти надежных исполнители с проверенными номерами телефонов и электронной почтой через UserUz..</p>\r\n        </div>', 'contents\\August2022\\b3vcbN90tZ3KmYOIZaMc.jpeg');
INSERT INTO `contents` VALUES (4, '2022-06-22 01:33:00', '2022-07-26 18:24:48', 'blogs_third', 'home', '<div class=\"sm:rounded-r-2xl rounded-r-2xl-none sm:rounded-none rounded-2xl sm:w-2/3 w-full p-3 shadow-md\">\r\n            <h1 class=\"text-lg text-gray-700 font-bold\">Ishonchli sharhlar</h1>\r\n            <p class=\"text-sm text-gray-600\">Mijozlar tomonidan 1000,000 dan ortiq sharhlar sizga to\'g\'ri rassomni tanlashga yordam beradi.</p>\r\n        </div>', '<div class=\"sm:rounded-r-2xl rounded-r-2xl-none sm:rounded-none rounded-2xl sm:w-2/3 w-full p-3 shadow-md\">\r\n            <h1 class=\"text-lg text-gray-700 font-bold\">Достоверные отзывы</h1>\r\n            <p class=\"text-sm text-gray-600\">Более 1 000 000 отзывов от заказчиков помогут выбрать подходящего исполнителя.</p>\r\n        </div>', 'contents\\July2022\\5OWmR68IzpSmVlScqWvV.jpg');
INSERT INTO `contents` VALUES (5, '2022-06-22 01:35:00', '2022-08-02 17:04:38', 'blogs_fourth', 'home', '<div class=\"sm:rounded-r-2xl rounded-r-2xl-none sm:rounded-none rounded-2xl sm:w-2/3 w-full p-3 shadow-md\">\r\n            <h1 class=\"text-lg text-gray-700 font-bold\">Oson va tez ish topin</h1>\r\n            <p class=\"text-sm text-gray-600\">Xarita orqali qidiruv sizning vaqtingizni tejaydi</p>\r\n        </div>', '<div class=\"sm:rounded-r-2xl rounded-r-2xl-none sm:rounded-none rounded-2xl sm:w-2/3 w-full p-3 shadow-md\">\r\n            <h1 class=\"text-lg text-gray-700 font-bold\">Найти заказы легко и быстро</h1>\r\n            <p class=\"text-sm text-gray-600\">Поиск по карте экономит ваше время</p>\r\n        </div>', 'contents\\June2022\\wRTQuVTZIk1gCBEdhplp.png');
INSERT INTO `contents` VALUES (6, '2022-06-22 01:39:00', '2022-06-22 01:39:00', 'economy_first', 'home', '<div class=\"border border-gray-300  mx-3 p-4 rounded-xl\">\r\n                    <span class=\"font-semibold\">\r\n                    <span class=\"text-yellow-500\">\r\n                        1.\r\n                    </span> Vazifalarni yarating\r\n                </span>\r\n                    <h1 class=\"my-02 text-base pb-2\">\r\n                      Bajarilishi kerak bo\'lgan vazifangizni o\'z so\'zlaringiz bilan tasvirlab bering\r\n                    </h1>\r\n                    <a href=\"/categories/1\"\r\n                       class=\"text-yellow-500 hover:text-white  p-1 rounded-lg transition duration-300 hover:bg-yellow-500\">\r\n                        Vazifalarni yarating\r\n                    </a>\r\n                </div>', '<div class=\"border border-gray-300  mx-3 p-4 rounded-xl\">\r\n                    <span class=\"font-semibold\">\r\n                    <span class=\"text-yellow-500\">\r\n                        1.\r\n                    </span>Создать задания\r\n                </span>\r\n                    <h1 class=\"my-02 text-base pb-2\">\r\n                       Опишите своими словами задачу, которую требуется выполнить\r\n                    </h1>\r\n                    <a href=\"/categories/1\"\r\n                       class=\"text-yellow-500 hover:text-white  p-1 rounded-lg transition duration-300 hover:bg-yellow-500\">\r\n                        Создать задания\r\n                    </a>\r\n                </div>', '');
INSERT INTO `contents` VALUES (7, '2022-06-22 01:40:44', '2022-06-22 01:40:44', 'economy_second', 'home', '<div class=\"border border-gray-300  mx-3 p-4 rounded-xl\">\n                    <span class=\"font-semibold\">\n                    <span class=\"text-yellow-500\">\n                        2.\n                    </span> Rassomlar sizga o\'z xizmatlari va narxlarini taklif etadilar\n                </span>\n                    <h1 class=\"text-base my-02\">\n                        Bir necha daqiqadan so\'ng, siz o\'z vazifangizni bajarishga tayyor bo\'lgan ijrochilarning javoblarini qabul qila boshlaysiz.\n                    </h1>\n                </div>', '<div class=\"border border-gray-300  mx-3 p-4 rounded-xl\">\n                    <span class=\"font-semibold\">\n                    <span class=\"text-yellow-500\">\n                        2.\n                    </span>Исполнители предложат вам свои услуги и цены\n                </span>\n                    <h1 class=\"text-base my-02\">\n                        Уже через пару минут вы начнете получать отклики от исполнителей, готовых выполнить ваше задание.\n                    </h1>\n                </div>', '');
INSERT INTO `contents` VALUES (8, '2022-06-22 01:43:00', '2022-06-23 15:21:31', 'economy_third', 'home', '<div class=\"border border-gray-300  mx-3 p-4 rounded-xl relative z-10\">\r\n                    <span class=\"font-semibold\">\r\n                    <span class=\"text-yellow-500\">\r\n                        3.\r\n                    </span> Eng yaxshi javobni tanlang\r\n\r\n                </span>\r\n                    <h1 class=\"text-base my-02\">\r\n                       Turli mezonlar bo\'yicha siz to\'g\'ri rassomni tanlashingiz mumkin:\r\n                    </h1>\r\n                    <div class=\"flex\">\r\n                        <i class=\"fas fa-thumbs-up text-yellow-400 mx-2 pr-3\"></i>\r\n                        <p class=\"text-lg\">Mijozlarning sharhlari</p>\r\n                    </div>\r\n                    <div class=\"flex\">\r\n                        <i class=\"fas fa-user-alt text-yellow-400 mx-2 pr-3\"></i>\r\n                        <p class=\"text-lg\">Ishning misollari</p>\r\n                    </div>\r\n                    <div class=\"flex\">\r\n                        <i class=\"fas fa-dollar-sign text-yellow-400 mx-2 pl-1 pr-4\"></i>\r\n                        <p class=\"text-lg\">Xizmat narxi</p>\r\n                    </div>\r\n                    <div class=\"flex\">\r\n                        <i class=\"fas fa-star text-yellow-400 mx-2 pr-3\"></i>\r\n                        <p class=\"text-lg\">Reyting</p>\r\n                    </div>\r\n                </div>', '<div class=\"border border-gray-300  mx-3 p-4 rounded-xl relative z-10\">\r\n                    <span class=\"font-semibold\">\r\n                    <span class=\"text-yellow-500\">\r\n                        3.\r\n                    </span> Выберите лучший отклик\r\n                </span>\r\n                    <h1 class=\"text-base my-02\">\r\n                        Вы сможете выбрать подходящего исполнителя, по разным критериям:\r\n                    </h1>\r\n                    <div class=\"flex\">\r\n                        <i class=\"fas fa-thumbs-up text-yellow-400 mx-2 pr-3\"></i>\r\n                        <p class=\"text-lg\">Отзывы заказчиков</p>\r\n                    </div>\r\n                    <div class=\"flex\">\r\n                        <i class=\"fas fa-user-alt text-yellow-400 mx-2 pr-3\"></i>\r\n                        <p class=\"text-lg\">Примеры работ</p>\r\n                    </div>\r\n                    <div class=\"flex\">\r\n                        <i class=\"fas fa-dollar-sign text-yellow-400 mx-2 pl-1 pr-4\"></i>\r\n                        <p class=\"text-lg\">Стоимость услуг</p>\r\n                    </div>\r\n                    <div class=\"flex\">\r\n                        <i class=\"fas fa-star text-yellow-400 mx-2 pr-3\"></i>\r\n                        <p class=\"text-lg\">Рейтинг</p>\r\n                    </div>\r\n                </div>', '');
