INSERT INTO `contents` VALUES (10, '2022-06-22 11:04:00', '2022-08-02 17:10:59', 'advantages_title', 'home', 'UserUz xizmatlarning asosiy afzalliklari', 'Основные преимущества UserUz', NULL);
INSERT INTO `contents` VALUES (11, '2022-06-22 11:07:00', '2022-08-02 17:18:50', 'advantages_first', 'home', '<span class=\"font-semibold\">Biz siz uchun buyurtma topamiz</span>\r\n            <p class=\"text-base\">\r\n               .Ko\'plab bajaruvchilar buyurtma topishda juda qiynalishadi va juda kop vaqt yoqotadi. Bizda esa uyda o\'tirgan xolda buyurtmalarni qabul qilish va ularni bajarish imkoniyatini yaratib beramiz. Bu esa sizdan oshiqcha xarajatlardan xalos etadi.\r\n            </p>\r\n\r\n            <span class=\"font-semibold\">\r\n                Tasdiqlangan ijrochilar\r\n            </span>\r\n            <p class=\"text-base\">\r\n               Xususiy pudratchilarda xizmat ko\'rsatish kompaniyalari odatda o\'z xizmatlari narxiga kiritadigan ofis xarajatlari, reklama, kotiblik maoshlari va boshqa xarajatlar yo\'q.\r\n            </p>\r\n\r\n            <span class=\"font-semibold\">\r\n                Vaqtni tejash            </span>\r\n            <p class=\"text-base pb-4\">\r\n              Universal Services-da siz bir necha daqiqada kerakli pudratchini topishingiz mumkin. Ularning ko\'pchiligi o\'sha kuni, ba\'zan esa bir soatda ishni boshlashga tayyor.\r\n            </p>', '<span class=\"font-semibold\">Мы найдем для вас заказ</span>\r\n            <p class=\"text-base\">\r\n              Многие исполнители с трудом находят заказы и тратят много времени. Мы делаем возможным получение заказов и их выполнение сидя дома. Это убережет вас от перерасхода.\r\n            </p>\r\n\r\n            <span class=\"font-semibold\">\r\n                Проверенные исполнители\r\n            </span>\r\n            <p class=\"text-base\">\r\n               Все исполнители Universal Services проходят процедуру верификации, мы проверяем отзывы, разбираемся с жалобами и контролируем качество их работы.\r\n            </p>\r\n\r\n            <span class=\"font-semibold\">\r\n                Экономия времени\r\n            </span>\r\n            <p class=\"text-base pb-4\">\r\n               На Universal Services вы можете найти подходящего исполнителя за несколько минут. Многие из них готовы приступить к работе в тот же день, а иногда в тот же час.\r\n            </p>', 'contents\\June2022\\6Ax71jQMSxsk41rd3fhs.png');
INSERT INTO `contents` VALUES (12, '2022-06-22 11:25:00', '2022-06-22 11:25:00', 'advantages_two', 'home', '<div class=\"float-left mr-5 my-2\">\r\n                <span class=\"text-yellow-500 font-semibold\">\r\n                    2 419 658\r\n                </span>\r\n                <p class=\"text-base\">\r\n                    topshiriqlar allaqachon bajarilgan\r\n                </p>\r\n            </div>\r\n            <div class=\"my-2\">\r\n                <span class=\"text-yellow-500 font-semibold\">\r\n                    617 014\r\n                </span>\r\n                <p class=\"text-base\">\r\n                 ijrochilar sizga yordam berishga tayyor\r\n                </p>\r\n            </div>\r\n            <div class=\"my-2\">\r\n                <span class=\"text-yellow-500 font-semibold\">\r\n                    35 sekund\r\n                </span>\r\n                <p class=\"text-base\">\r\n                   vazifangizga birinchi javob berishdan oldin\r\n                </p>\r\n            </div>', '<div class=\"float-left mr-5 my-2\">\r\n                <span class=\"text-yellow-500 font-semibold\">\r\n                    2 419 658\r\n                </span>\r\n                <p class=\"text-base\">\r\n                     заданий уже выполнены\r\n                </p>\r\n            </div>\r\n            <div class=\"my-2\">\r\n                <span class=\"text-yellow-500 font-semibold\">\r\n                    617 014\r\n                </span>\r\n                <p class=\"text-base\">\r\n                     исполнителей готовы помочь вам\r\n                </p>\r\n            </div>\r\n            <div class=\"my-2\">\r\n                <span class=\"text-yellow-500 font-semibold\">\r\n                      35 секунд\r\n                </span>\r\n                <p class=\"text-base\">\r\n                    до первого отклика на ваше задание\r\n                </p>\r\n            </div>', NULL);
INSERT INTO `contents` VALUES (13, '2022-06-22 11:39:00', '2022-06-22 19:02:00', 'verification_header', 'verification', '<p class=\"text-4xl lg:text-6xl font-bold text-white \">Universal xizmatlar ijrochisiga aylaning</p>\r\n            <p class=\"mt-8 mb-12 text-white text-xl lg:text-2xl\">Universal Services sizga yangi mijozlarni topishga va har qanday xizmatlardan <br> ishlab topishga yordam beradi</p>\r\n <a href=\"/verification/verificationInfo\">\r\n                <button  class=\"px-10 py-4 font-sans  text-lg  font-semibold bg-yellow-500 hover:bg-yellow-600 text-white rounded-md text-xl\">\r\n                   Ijrochi bo\'ling\r\n                </button>\r\n            </a>', '<p class=\"text-4xl lg:text-6xl font-bold text-white \">Станьте исполнителем Universal Services</p>\r\n            <p class=\"mt-8 mb-12 text-white text-xl lg:text-2xl\">Universal Services поможет найти новых клиентов и зарабатывать <br> на выполнении любых услуг.</p>\r\n <a href=\"/verification/verificationInfo\">\r\n                <button  class=\"px-10 py-4 font-sans  text-lg  font-semibold bg-yellow-500 hover:bg-yellow-600 text-white rounded-md text-xl\">\r\n                    СТАТЬ ИСПОЛНИТЕЛЕМ\r\n                </button>\r\n            </a>', 'contents\\June2022\\AkQZDycQ86zsc68LrYP4.jpeg');
INSERT INTO `contents` VALUES (14, '2022-06-22 12:38:00', '2022-06-22 12:38:00', 'Advantages_title', 'verification', '<h1 class=\"text-4xl font-bold\">Afzalliklar</h1>\r\n <p class=\"font-bold mt-16\">O\'zingiz uchun qulay vaqtda ijrochi bo\'ling va mijozlarning qiziqarli topshiriqlarini bajaring</p>', '<h1 class=\"text-4xl font-bold\">Преимущества</h1>\r\n<p class=\"font-bold mt-16\">Станьте исполнителем и выполняйте интересные задания от заказчиков  в удобное для вас время</p>', NULL);
