INSERT INTO `contents` VALUES (19, '2022-06-22 12:47:00', '2022-06-22 12:47:00', 'to_order_process', 'verification', '<h2 class=\"font-sans text-5xl pb-8 font-bold\">Buyurtmani qanday olish mumkin</h2>\r\n<p class=\"font-sans text-xl pb-16 font-medium\">Universal xizmatlarda pudratchilar buyurtmalar va mijozlarni o\'zlari tanlaydilar. Bu oddiy.</p>', '<h2 class=\"font-sans text-5xl pb-8 font-bold\">Как получить заказ</h2>\r\n<p class=\"font-sans text-xl pb-16 font-medium\">На Universal Services исполнители сами выбирают заказы и клиентов. Это просто.</p>', NULL);
INSERT INTO `contents` VALUES (20, '2022-06-22 12:54:00', '2022-06-22 12:54:00', 'to_order_1', 'verification', '<p class=\"text-purple-600 text-8xl pb-4\">1</p>\r\n                        <p class=\"text-lg text-black\">Ijrochi bo\'ling va profilingizni to\'ldiring</p>', '<p class=\"text-purple-600 text-8xl pb-4\">1</p>\r\n                        <p class=\"text-lg text-black\">Станьте исполнителем и заполните профиль</p>', NULL);
