INSERT INTO `contents` VALUES (22, '2022-06-22 12:58:00', '2022-06-22 12:58:00', 'to_order_3', 'verification', '<p class=\"text-purple-600 text-8xl pb-4\">3</p>\r\n                        <p class=\"text-lg text-black\">Vazifani bajargandan so\'ng darhol to\'lovni oling</p>', '<p class=\"text-purple-600 text-8xl pb-4\">3</p>\r\n                        <p class=\"text-lg text-black\">Получите оплату сразу же после выполнения задания</p>', NULL);
INSERT INTO `contents` VALUES (23, '2022-06-22 13:02:00', '2022-06-22 17:40:26', 'first_performer', 'verification', '<h1 class=\"font-bold text-3xl\">Munosib daromad</h1>\r\n                <p class=\"mt-6 text-lg\">Universal xizmatlar bilan cheklanmagan buyurtmalar bo\'yicha pul ishlang. Xizmatdan yarim kunlik ish uchun foydalaning yoki o\'z biznesingizni rivojlantirishni boshlang.</p>\r\n                <hr class=\"mt-8 mb-8\">\r\n                <p class=\"mb-12\">Universal Services.com saytida maksimal buyurtma deyarli 100 000 uzni tashkil etdi, bir necha kun davomida men hech kim o\'z zimmasiga olishni istamagan muammoni hal qilardim.</p>\r\n<a href=\"/verification/verificationInfo\">\r\n                    <button  class=\"px-10 py-4 font-sans  text-lg mt-8 font-semibold bg-yellow-500 hover:bg-yellow-600 text-white rounded-md text-xl\">\r\n                       Daromad olishni boshlang\r\n                    </button>\r\n                </a>', '<h1 class=\"font-bold text-3xl\">Достойный заработок</h1>\r\n                <p class=\"mt-6 text-lg\">Зарабатывайте на заказах с Universal Services без ограничений. Используйте сервис для подработки или начните развивать собственное дело.</p>\r\n                <hr class=\"mt-8 mb-8\">\r\n                <p class=\"mb-12\">Максимальный заказ на Universal Services.com был почти на 100 000 uzs, я несколько дней решал проблему, за которую никто не хотел браться.</p>\r\n<a href=\"/verification/verificationInfo\">\r\n                    <button  class=\"px-10 py-4 font-sans  text-lg mt-8 font-semibold bg-yellow-500 hover:bg-yellow-600 text-white rounded-md text-xl\">\r\n                        Начать зарабатывать\r\n                    </button>\r\n                </a>', 'contents\\June2022\\Z33oy58ZHguxd7QQ8uqu.jpg');
INSERT INTO `contents` VALUES (24, '2022-06-22 13:06:00', '2022-06-22 17:40:08', 'second_performer', 'verification', '<h1 class=\"font-bold text-3xl\">Erkin jadval</h1>\r\n                <p class=\"mt-6 text-lg\">Universal xizmatlarda siz o\'zingiz uchun ishlaysiz va mijozlaringizni tanlaysiz. Vazifalarni o\'zingiz uchun qulay vaqtda bajaring va xohlagan vaqtda dam olish kunlarini tashkil qiling</p>\r\n                <hr class=\"mt-8 mb-8\">\r\n                <p class=\"mb-12\">Xizmat menga mijozlar bazasini rivojlantirishda katta yordam berdi, buni salonda qilish har doim juda qiyin. Soch kesish yoki bo\'yash uchun uchinchi yoki to\'rtinchi marta kelgan mijozlarim bor, ya\'ni ular doimiy mijozlarga aylanishadi.</p>\r\n <a href=\"/verification/verificationInfo\">\r\n                    <button  class=\"px-10 py-4 font-sans  text-lg mt-8 font-semibold bg-yellow-500 hover:bg-yellow-600 text-white rounded-md text-xl\">\r\n                       O\'zingiz uchun ishlashni boshlang\r\n                    </button>\r\n                </a>', '<h1 class=\"font-bold text-3xl\">Свободный график</h1>\r\n                <p class=\"mt-6 text-lg\">На Universal Services вы работаете на себя и сами выбираете заказчиков. Выполняйте задания в удобное для вас время и устраивайте выходные, когда захотите</p>\r\n                <hr class=\"mt-8 mb-8\">\r\n                <p class=\"mb-12\">Сервис мне очень помог в наработке клиентской базы, что всегда очень сложно сделать в салоне. У меня уже есть заказчики, которые приходят на стрижку или окрашивание в третий, четвертый раз, то есть становятся постоянными клиентами.</p>\r\n <a href=\"/verification/verificationInfo\">\r\n                    <button  class=\"px-10 py-4 font-sans  text-lg mt-8 font-semibold bg-yellow-500 hover:bg-yellow-600 text-white rounded-md text-xl\">\r\n                       Начать работать на себя\r\n                    </button>\r\n                </a>', 'contents\\June2022\\fdDJRwijebRuRxkw61hv.jpg');
INSERT INTO `contents` VALUES (25, '2022-06-22 15:51:00', '2022-06-22 17:39:00', 'third_performer', 'verification', '<h1 class=\"font-bold text-3xl\">Xizmat xavfsizligi</h1>\r\n                <p class=\"mt-6 text-lg\">Xavfsiz bitim bilan mijozlar sharhlarini o\'qing va vazifalarni bajaring: ishni muvaffaqiyatli yakunlaganingizdan so\'ng, kartada to\'lovni olishingiz kafolatlanadi.</p>\r\n                <hr class=\"mt-8 mb-8\">\r\n                <p class=\"mb-12\">Risksiz shartnoma bilan siz to\'lov olmaslik haqida tashvishlanishingiz shart emas. Agar shunday bo\'lsa, vazifa avtomatik ravishda yopiladi</p>\r\n                <a href=\"/verification/verificationInfo\">\r\n                    <button  class=\"px-10 py-4 font-sans  text-lg mt-8 font-semibold bg-yellow-500 hover:bg-yellow-600 text-white rounded-md text-xl\">\r\n                           Rassom maqomini oling\r\n                    </button>\r\n                </a>', '<h1 class=\"font-bold text-3xl\">Безопасность сервиса</h1>\r\n                <p class=\"mt-6 text-lg\">Читайте отзывы о заказчиках и выполняйте задания со Сделкой без риска: при успешном завершении работы вы гарантированно получите оплату на карту.</p>\r\n                <hr class=\"mt-8 mb-8\">\r\n                <p class=\"mb-12\">Со Сделкой без риска не переживаешь, что оплата не поступит. Если что, задание закрывается автоматически</p>\r\n               <a href=\"/verification/verificationInfo\">\r\n                    <button  class=\"px-10 py-4 font-sans  text-lg mt-8 font-semibold bg-yellow-500 hover:bg-yellow-600 text-white rounded-md text-xl\">\r\n                        Получить статус исполнителя\r\n                    </button>\r\n                </a>', 'contents\\June2022\\ZPIjP1yijy409Ou15Op2.jpg');
INSERT INTO `contents` VALUES (26, '2022-06-22 15:56:00', '2022-06-22 17:19:00', 'fourth_performer', 'verification', '<h1 class=\"font-bold text-3xl\">Reklama uchun tejamkorlik</h1>\r\n                <p class=\"mt-6 text-lg\">Endi siz o\'z veb-saytingiz va reklamangizga pul sarflashingiz shart emas - vazifalarni tanlang va hozirda xizmatga muhtoj bo\'lgan mijozlarga fikr-mulohazalaringizni yuboring.</p>\r\n                <hr class=\"mt-12 mb-8\">\r\n                <p class=\"mb-12\">Xizmat menga mijozlar bazasini rivojlantirishda katta yordam berdi, buni salonda qilish har doim juda qiyin. Soch kesish yoki bo\'yash uchun uchinchi yoki to\'rtinchi marta kelgan mijozlarim bor, ya\'ni ular doimiy mijozlarga aylanishadi.</p>\r\n                <a href=\"/verification/verificationInfo\">\r\n                    <button  class=\"px-10 py-4 font-sans  text-lg mt-8 font-semibold bg-yellow-500 hover:bg-yellow-600 text-white rounded-md text-xl\">\r\n                             Ijrochi bo\'ling\r\n                    </button>\r\n                </a>', '<h1 class=\"font-bold text-3xl\">Экономия на рекламе</h1>\r\n                <p class=\"mt-6 text-lg\">Больше не нужно тратить деньги на собственный сайт и рекламу — выбирайте задания и отправляйте отклики заказчикам, которым услуга нужна прямо сейчас.</p>\r\n                <hr class=\"mt-12 mb-8\">\r\n                <p class=\"mb-12\">Сервис мне очень помог в наработке клиентской базы, что всегда очень сложно сделать в салоне. У меня уже есть заказчики, которые приходят на стрижку или окрашивание в третий, четвертый раз, то есть становятся постоянными клиентами.</p>\r\n                <a href=\"/verification/verificationInfo\">\r\n                    <button  class=\"px-10 py-4 font-sans  text-lg mt-8 font-semibold bg-yellow-500 hover:bg-yellow-600 text-white rounded-md text-xl\">\r\n                            СТАТЬ ИСПОЛНИТЕЛЕМ\r\n                    </button>\r\n                </a>', 'contents\\June2022\\uutT435ODU3oNOjYseGj.jpg');
INSERT INTO `contents` VALUES (27, '2022-06-22 16:01:00', '2022-06-22 16:01:00', 'video_section_title', 'verification', '<h1 class=\"font-bold text-4xl\">Universal Services bilan daromad oling va maqsadlaringizga <br> erishing</h1>\r\n            <p class=\"text-xl mt-8 font-medium\">Bizning ijrochilar buni har kuni qilishadi.</p>', '<h1 class=\"font-bold text-4xl\">Зарабатывайте и добивайтесь <br> своих целей с Universal Services</h1>\r\n            <p class=\"text-xl mt-8 font-medium\">Наши исполнители делают это каждый день.</p>', NULL);
