INSERT INTO `contents` VALUES (30, '2022-06-22 16:13:00', '2022-06-22 17:20:24', 'video_section_text1', 'verification', '<p class=\" text-lg\">Universal xizmatlar menga bepul qolishimga yordam beradi. Jadval tig‘iz bo‘lishiga qaramay, o‘zim qaror qilaman, qachon turish, qayerga borish, nima qilish kerakligini hech kim aytmaydi.</p>\r\n                <h1 class=\"font-bold text-6xl mt-4\">65 000</h1>\r\n                <p class=\"text-lg font-medium mt-4\">O\'rtacha oylik daromad <br> \"Kuryer xizmatlari\" turkumidagi</p>\r\n                <a href=\"/verification/verificationInfo\">\r\n                    <button  class=\"px-10 py-4 font-sans mt-16 text-lg mt-8 font-semibold bg-yellow-500 hover:bg-yellow-600 text-white rounded-md text-xl\">\r\n                            Ijrochi bo\'ling\r\n                    </button>\r\n                </a>', '<p class=\" text-lg\">Universal Services помогает мне оставаться свободным. Несмотря на то, что график плотный, я решаю сам, не кто-то мне говорит, когда мне встать, куда приехать, что сделать.</p>\r\n                <h1 class=\"font-bold text-6xl mt-4\">65 000</h1>\r\n                <p class=\"text-lg font-medium mt-4\">Средний месячный доход <br> в категории «Курьерские услуги»</p>\r\n                <a href=\"/verification/verificationInfo\">\r\n                    <button  class=\"px-10 py-4 font-sans mt-16 text-lg mt-8 font-semibold bg-yellow-500 hover:bg-yellow-600 text-white rounded-md text-xl\">\r\n                      СТАТЬ ИСПОЛНИТЕЛЕМ\r\n                    </button>\r\n                </a>', NULL);
INSERT INTO `contents` VALUES (31, '2022-06-22 16:16:00', '2022-06-22 17:20:00', 'video_section_text2', 'verification', '<p class=\" text-lg\">Endi shu daraja o\'sib bordiki, men mijozlarning mijozlarini ham suratga olaman. Ba\'zi mijozlar meni do\'stlari va tanishlariga tavsiya qilishadi. Va, albatta, Universal Servicesdan ko\'plab buyurtmalar keladi.</p>\r\n                <h1 class=\"font-bold text-6xl mt-4\">70 000</h1>\r\n                <p class=\"text-lg font-medium mt-4\">Foto va video xizmatlari\" turkumidagi o\'rtacha oylik daromad <br></p>\r\n                <a href=\"/verification/verificationInfo\">\r\n                    <button  class=\"px-10 py-4 font-sans mt-16 text-lg mt-8 font-semibold bg-yellow-500 hover:bg-yellow-600 text-white rounded-md text-xl\">\r\n                           Ijrochi bo\'ling\r\n                    </button>\r\n                </a>', '<p class=\" text-lg\">Сейчас уже дорос уровень до того, что я снимаю и клиентов клиентов. Одни клиенты рекомендуют меня своим друзьям, знакомым. И много, конечно, заказов идет с Universal Services.</p>\r\n                <h1 class=\"font-bold text-6xl mt-4\">70 000</h1>\r\n                <p class=\"text-lg font-medium mt-4\">Средний месячный доход <br> в категории «Фото и видео услуги»</p>\r\n                <a href=\"/verification/verificationInfo\">\r\n                    <button  class=\"px-10 py-4 font-sans mt-16 text-lg mt-8 font-semibold bg-yellow-500 hover:bg-yellow-600 text-white rounded-md text-xl\">\r\n                          СТАТЬ ИСПОЛНИТЕЛЕМ\r\n                    </button>\r\n                </a>', NULL);
INSERT INTO `contents` VALUES (32, '2022-06-22 16:20:00', '2022-06-22 16:44:11', 'modal_section_1', 'verification', 'Uberni eslatuvchi juda ajoyib xizmat. Foydalanish qulay, ayniqsa mijoz tomonidan - har qanday murakkab va unchalik katta bo\'lmagan muammolar tez va arzon tarzda hal qilinadi. Cheksiz paketlar ustida ishlaydigan ijrochi sifatida aytishim mumkinki, men xarajatlarni to\'liq qopladim, qora rangda qoldim, men uzaytirish haqida o\'ylayapman. Agar xizmat butun Rossiya bo\'ylab ishlasa, masalan, Sochida yaxshi bo\'lar edi. Bir oy dam olishga keldi, kuniga 3 soat ishladi - 2 oy qoldi. Sizga farovonlik va muvaffaqiyat! Men hamkorlik qilishdan juda xursandman!', 'Очень крутой сервис, напоминает Uber. Удобно пользоваться, особенно со стороны заказчика — быстро и дешево решаются любые сложныеи не очень проблемы. Как исполнитель, работающий по безлимитным пакетам, могу сказать, что стоимость полностью отбил, остался в плюсе, думаю насчет продления. Было бы круто, чтобы сервис работал по всей России, например, в Сочи. Прилетел отдыхать на месяц, по 3 часа в день работаешь — остался на 2 месяца. Процветания и успехов вам! Очень рад сотрудничеству!', NULL);
