INSERT INTO `contents` VALUES (35, '2022-06-22 17:22:00', '2022-06-22 17:37:00', 'verificationInfo', 'verificationInfo', '<p class=\"text-2xl font-semibold mt-5\">\r\n              bizga o\'zingiz haqingizda aytib bering\r\n            </p>\r\n            <p class=\"text-base mt-5 mb-5 px-5\">\r\n               Kontakt ma\'lumotlaringizni kiriting va ishlashni xohlagan ish toifalarini tanlang. Hamma narsa taxminan 3 daqiqa davom etadi.\r\n            </p>\r\n            <button id=\"btnclck\" class=\"text-base my-3 px-7 rounded-md py-3 bg-green-700 text-white mb-2\">\r\n                 Boshlaylik\r\n            </button>', '<p class=\"text-2xl font-semibold mt-5\">\r\n                Расскажите о себе\r\n            </p>\r\n            <p class=\"text-base mt-5 mb-5 px-5\">\r\n               Укажите свои контактные данные и выберите категории заданий, в которых вы хотите работать. На всё уйдёт примерно 3 минуты.\r\n            </p>\r\n            <button id=\"btnclck\" class=\"text-base my-3 px-7 rounded-md py-3 bg-green-700 text-white mb-2\">\r\n               Начнём\r\n            </button>', 'contents\\June2022\\A1RmOt71BQPc68v7xP5l.png');
INSERT INTO `contents` VALUES (36, '2022-06-22 17:34:00', '2022-08-29 14:25:14', 'profile_text', 'profile', 'Foydalanuvchilarning o\'zingizga bo\'lgan ishonchini oshiring - ijtimoiy tarmoq hisoblaringizni Universal Services profilingizga bog\'lang. Biz sizning kontaktlaringizni oshkor qilmaslik majburiyatini olamiz.', 'Повысьте доверие пользователей к себе — привяжите ваши аккаунты социальных сетей к профилю Universal Services. Мы обязуемся не раскрывать ваши контакты.', NULL);
