INSERT INTO `faq_categories` VALUES (1, 'Как пользоваться сервисом', 'Рассказываем, как заказать услугу или стать исполнителем, а ещё как общаться на сервисе. Новым исполнителям: как взять первое задание и начать зарабатывать. И немного о самых важных правилах площадки.', 'admin', 16, '2021-12-16 18:22:00', '2022-01-06 18:20:17', 'faq-categories/faq-chat-png.png');
INSERT INTO `faq_categories` VALUES (2, 'Проблемы с доступом к аккаунту', 'Даже если доступ к аккаунту утерян, его можно восстановить самостоятельно.', 'admin', 2, '2021-12-16 18:24:00', '2022-01-06 18:18:55', 'faq-categories/faq-chat-png.png');
INSERT INTO `faq_categories` VALUES (3, 'Мой профиль', 'Заказчикам: как обновить контакты. Исполнителям: как правильно оформить профиль, что такое рейтинг и что сделать, чтобы повысить доверие заказчиков.', 'admin', 11, '2021-12-16 18:25:00', '2022-01-06 18:15:07', 'faq-categories/faq-chat-png.png');
INSERT INTO `faq_categories` VALUES (4, 'Задания', 'Всё, что касается создания задания и последующих изменений. А ещё как искать задания и что делает процесс поиска быстрее и удобнее.', 'admin', 8, '2021-12-16 18:26:00', '2022-01-06 18:13:44', 'faq-categories/faq-chat-png.png');
INSERT INTO `faq_categories` VALUES (5, 'Оплата', 'Про оплату услуг, про Сделку без риска и про задания для самозанятых, ИП или юр.лиц.', 'admin', 15, '2021-12-16 18:27:00', '2022-01-06 18:12:32', 'faq-categories/faq-chat-png.png');
INSERT INTO `faq_categories` VALUES (6, 'Безопасность', 'Всё, что нужно знать, чтобы не столкнуться с неприятностями, заказывая услуги и выполняя задания.', 'admin', 5, '2021-12-16 18:28:00', '2022-01-06 18:11:23', 'faq-categories/faq-chat-png.png');
INSERT INTO `faq_categories` VALUES (7, 'Спорные ситуации', 'Если что-то пошло не так, мы подключимся. Прочитайте о том, что такое арбитраж и как происходит компенсация материального ущерба.', 'admin', 5, '2021-12-16 18:29:00', '2022-01-06 18:09:46', 'faq-categories/faq-chat-png.png');
