INSERT INTO `massmedia` VALUES (1, '2022-01-22 12:21:20', '2022-01-22 12:21:20', 'ТАСС / Universal Services и \'Яндекс.Про\' составили портрет самозанятого', 'Совместно с Яндекс.Про провели исследование и узнали уровень дохода самозанятых, причины, по которым люди переходят на этот режим, а также основные плюсы и минусы, по мнению исполнителей. Кроме того, узнали главные факторы, благодаря которым самозанятые делают выбор в пользу платформенной занятости в России.');
INSERT INTO `massmedia` VALUES (2, '2022-01-22 12:22:22', '2022-01-22 12:22:22', 'Российская Газета / Ремонт квартир дорожает из-за роста цен на материалы и услуги рабочих', 'Поделились с Российской Газетой данными о росте стоимости строительства и ремонта, выяснили причины, а также рассказали о том, чего стоит ждать в будущем.');
INSERT INTO `massmedia` VALUES (3, '2022-01-22 12:23:31', '2022-01-22 12:23:31', 'РБК / Подорожание техники и электроники толкнуло петербуржцев на вторичный рынок', 'Выяснили, где чаще всего встречается повышенный интерес к ремонту домашней техники. В Петербурге спрос на ремонт электроники и гаджетов вырос вдвое за последни три месяца.');
