INSERT INTO `translations` VALUES (450, 'faq_categories', 'title', 7, 'uz', 'Bahsli vaziyatlar', '2022-01-06 18:09:46', '2022-01-06 18:09:46');
INSERT INTO `translations` VALUES (451, 'faq_categories', 'description', 7, 'uz', 'Agar biror narsa noto\'g\'ri bo\'lsa, biz ulanamiz. Arbitraj nima ekanligini va moddiy zararni qoplash qanday sodir bo\'lishi haqida o\'qing.', '2022-01-06 18:09:46', '2022-01-06 18:09:46');
INSERT INTO `translations` VALUES (452, 'faq_categories', 'cat_author', 7, 'uz', 'admin', '2022-01-06 18:09:46', '2022-01-06 18:09:46');
INSERT INTO `translations` VALUES (453, 'faq_categories', 'title', 6, 'uz', 'Xavfsizlik', '2022-01-06 18:11:23', '2022-01-06 18:11:23');
INSERT INTO `translations` VALUES (454, 'faq_categories', 'description', 6, 'uz', 'Xizmatlarga buyurtma berish va vazifalarni bajarishda muammoga duch kelmaslik uchun bilishingiz kerak bo\'lgan hamma narsa.', '2022-01-06 18:11:23', '2022-01-06 18:11:23');
INSERT INTO `translations` VALUES (455, 'faq_categories', 'cat_author', 6, 'uz', 'admin', '2022-01-06 18:11:23', '2022-01-06 18:11:23');
INSERT INTO `translations` VALUES (456, 'faq_categories', 'title', 5, 'uz', 'To\'lov', '2022-01-06 18:12:32', '2022-01-06 18:12:32');
INSERT INTO `translations` VALUES (457, 'faq_categories', 'description', 5, 'uz', 'Xizmatlar uchun to\'lovlar, xavf-xatarsiz bitim haqida va yakka tartibdagi tadbirkorlar, yakka tartibdagi tadbirkorlar yoki yuridik shaxslar uchun vazifalar haqida.', '2022-01-06 18:12:32', '2022-01-06 18:12:32');
INSERT INTO `translations` VALUES (458, 'faq_categories', 'cat_author', 5, 'uz', 'admin', '2022-01-06 18:12:32', '2022-01-06 18:12:32');
INSERT INTO `translations` VALUES (459, 'faq_categories', 'title', 4, 'uz', 'Topshiriqlar', '2022-01-06 18:13:44', '2022-01-06 18:13:44');
INSERT INTO `translations` VALUES (460, 'faq_categories', 'description', 4, 'uz', 'Vazifa yaratish va keyingi o\'zgarishlar bilan bog\'liq hamma narsa. Va shuningdek, vazifalarni qanday qidirish kerak va nima qidiruv jarayonini tezroq va qulayroq qiladi.', '2022-01-06 18:13:44', '2022-01-06 18:13:44');
INSERT INTO `translations` VALUES (461, 'faq_categories', 'cat_author', 4, 'uz', 'admin', '2022-01-06 18:13:44', '2022-01-06 18:13:44');
INSERT INTO `translations` VALUES (462, 'faq_categories', 'title', 3, 'uz', 'Mening profilim', '2022-01-06 18:15:07', '2022-01-06 18:15:07');
INSERT INTO `translations` VALUES (463, 'faq_categories', 'description', 3, 'uz', 'Mijozlar uchun: kontaktlarni qanday yangilash kerak. Ijrochilar uchun: profilni qanday qilib to\'g\'ri loyihalash, reyting nima va mijozlar ishonchini oshirish uchun nima qilish kerak.', '2022-01-06 18:15:07', '2022-01-06 18:16:36');
INSERT INTO `translations` VALUES (464, 'faq_categories', 'cat_author', 3, 'uz', 'admin', '2022-01-06 18:15:07', '2022-01-06 18:15:07');
INSERT INTO `translations` VALUES (465, 'faq_categories', 'title', 2, 'uz', 'Akauntga kirish bilan bog\'liq muammolar', '2022-01-06 18:18:55', '2022-01-06 18:18:55');
INSERT INTO `translations` VALUES (466, 'faq_categories', 'description', 2, 'uz', 'Akauntingizga kirish yo\'qolgan bo\'lsa ham, uni o\'zingiz tiklashingiz mumkin.', '2022-01-06 18:18:55', '2022-01-06 18:18:55');
INSERT INTO `translations` VALUES (467, 'faq_categories', 'cat_author', 2, 'uz', 'admin', '2022-01-06 18:18:55', '2022-01-06 18:18:55');
INSERT INTO `translations` VALUES (468, 'faq_categories', 'title', 1, 'uz', 'Xizmatdan qanday foydalanish kerak', '2022-01-06 18:20:18', '2022-01-06 18:20:18');
INSERT INTO `translations` VALUES (469, 'faq_categories', 'description', 1, 'uz', 'Sizga qanday qilib xizmatga buyurtma berish yoki ijrochi bo\'lishni, shuningdek, xizmatda qanday bog\'lanishni aytib beramiz. Yangi ijrochilar: birinchi vazifani qanday bajarish va pul ishlashni boshlash. Va saytning eng muhim qoidalari haqida bir oz.', '2022-01-06 18:20:18', '2022-01-06 18:20:18');
INSERT INTO `translations` VALUES (470, 'faq_categories', 'cat_author', 1, 'uz', 'admin', '2022-01-06 18:20:18', '2022-01-06 18:20:18');
INSERT INTO `translations` VALUES (471, 'how_work_its', 'title', 3, 'uz', 'Eng yaxshi javobni tanlang', '2022-01-10 15:31:08', '2022-01-10 15:31:08');
INSERT INTO `translations` VALUES (472, 'how_work_its', 'description', 3, 'uz', '<h5 class=\"text-2xl my-8\">Turli mezonlarga ko\'ra mos ijrochini tanlashingiz mumkin:</h5>\n<div class=\"grid grid-cols-1 text-gray-500\">\n<div class=\"\"><em class=\"fas fa-ruble-sign\"> Xizmatlar narxi</em></div>\n<div class=\"\"><em class=\"fas fa-thumbs-up\"> Mijozlarning sharhlari</em></div>\n<div class=\"\"><em class=\"fas fa-star\"> Reyting</em></div>\n<div class=\"\"><em class=\"fas fa-user-alt\"> Ishga misollar</em></div>\n</div>', '2022-01-10 15:31:08', '2022-01-10 15:31:08');
INSERT INTO `translations` VALUES (473, 'how_work_its', 'title', 1, 'uz', 'Vazifa yarating', '2022-01-10 15:33:12', '2022-01-10 15:33:12');
INSERT INTO `translations` VALUES (474, 'how_work_its', 'description', 1, 'uz', '<h5 class=\"md:text-2xl text-lg my-8\">Bajarmoqchi bo\'lgan vazifani o\'z so\'zlaringiz bilan tasvirlab bering.</h5>\n<h5 class=\"text-2xl text-blue-400 underline hover:text-red-500\">Vazifa yaratish</h5>', '2022-01-10 15:33:13', '2022-01-10 15:33:52');
INSERT INTO `translations` VALUES (475, 'how_work_its', 'title', 2, 'uz', 'Ijrochilar sizga o\'z xizmatlari va narxlarini taklif qilishadi', '2022-01-10 15:33:34', '2022-01-10 15:33:34');
INSERT INTO `translations` VALUES (476, 'how_work_its', 'description', 2, 'uz', '<h5 class=\"text-2xl my-8\">Bir necha daqiqadan so\'ng siz vazifangizni bajarishga tayyor bo\'lgan ijrochilardan fikr-mulohazalarni olishni boshlaysiz.</h5>', '2022-01-10 15:33:34', '2022-01-10 15:33:34');
