INSERT INTO `translations` VALUES (537, 'advants', 'description', 6, 'uz', 'Xususiy ijrochilarlarda xizmat ko\'rsatish kompaniyalari odatda o\'z xizmatlari narxiga kiritadigan ofis xarajatlari, reklama, kotiblik maoshlari va boshqa xarajatlar yo\'q.', '2022-01-15 15:42:37', '2022-01-15 15:42:37');
INSERT INTO `translations` VALUES (540, 'advants', 'title', 7, 'uz', 'Ishonchli ijrochilar', '2022-01-15 15:46:37', '2022-01-15 15:46:37');
INSERT INTO `translations` VALUES (541, 'advants', 'description', 7, 'uz', 'Barcha Universal Services ijrochilari tekshirish jarayonidan o\'tadilar, biz sharhlarni tekshiramiz, shikoyatlarni ko\'rib chiqamiz va ularning ish sifatini nazorat qilamiz.', '2022-01-15 15:46:37', '2022-01-15 15:49:05');
INSERT INTO `translations` VALUES (542, 'advants', 'title', 8, 'uz', 'Vaqtni tejash', '2022-01-15 15:48:19', '2022-01-15 15:48:19');
INSERT INTO `translations` VALUES (543, 'advants', 'description', 8, 'uz', 'Universal Servicesda siz bir necha daqiqada kerakli ijrochini topishingiz mumkin. Ularning ko\'pchiligi o\'sha kuni, ba\'zan esa bir soatda ishni boshlashga tayyor.', '2022-01-15 15:48:19', '2022-01-15 15:48:19');
