INSERT INTO `translations` VALUES (552, 'massmedia', 'title', 1, 'uz', 'ТАСС / Universal Services va \'Yandex.Pro\' yakka tartibdagi tadbirkorning portretini tuzdi', '2022-01-22 12:21:20', '2022-01-22 12:21:20');
INSERT INTO `translations` VALUES (553, 'massmedia', 'description', 1, 'uz', 'Yandex.Pro bilan birgalikda amalga oshirdik tadqiqot va yakka tartibdagi tadbirkorlarning daromad darajasini, odamlarning ushbu rejimga o\'tish sabablarini, shuningdek, ijrochilarning fikriga ko\'ra, asosiy ijobiy va salbiy tomonlarini bilib oldim.', '2022-01-22 12:21:20', '2022-01-22 12:21:20');
INSERT INTO `translations` VALUES (554, 'massmedia', 'title', 2, 'uz', 'Rossiyskaya gazeta / Kvartirani ta\'mirlash materiallar va ishchilar xizmatlari narxining oshishi tufayli qimmatlashmoqda', '2022-01-22 12:22:22', '2022-01-22 12:22:22');
INSERT INTO `translations` VALUES (555, 'massmedia', 'description', 2, 'uz', 'Ulashish Rossiyskaya gazeta Qurilish va ta\'mirlash xarajatlarining o\'sishi to\'g\'risidagi ma\'lumotlar, sabablarini aniqladi, shuningdek, kelajakda nima kutish kerakligi haqida gapirdi.', '2022-01-22 12:22:22', '2022-01-22 12:22:22');
INSERT INTO `translations` VALUES (556, 'massmedia', 'title', 3, 'uz', 'РБК / Texnologiya va elektronika narxlarining oshishi Peterburg aholisini ikkilamchi bozorga olib chiqdi', '2022-01-22 12:23:31', '2022-01-22 12:23:31');
INSERT INTO `translations` VALUES (557, 'massmedia', 'description', 3, 'uz', 'Aniqlandi, Maishiy texnikani ta\'mirlashga bo\'lgan qiziqish eng ko\'p uchraydi. Sankt-Peterburgda so\'nggi uch oy ichida elektronika va gadjetlarni ta\'mirlashga talab ikki barobar oshdi.', '2022-01-22 12:23:31', '2022-01-22 12:23:31');
