INSERT INTO `translations` VALUES (1066, 'menu_items', 'title', 136, 'uz', 'Privacies', '2022-08-29 15:30:15', '2022-08-29 15:30:15');
INSERT INTO `translations` VALUES (1067, 'privacies', 'title', 2, 'uz', 'Litsenziyadan foydalanish', '2022-08-29 15:51:19', '2022-08-29 15:51:19');
INSERT INTO `translations` VALUES (1068, 'privacies', 'text', 2, 'uz', 'Faqat shaxsiy, notijorat oʻtkinchi koʻrish uchun har bir qurilmaga Oson Aptekaning bir nusxasini vaqtincha yuklab olishga ruxsat berilgan. Bu litsenziya berish emas, mulk huquqini o\'tkazish emas va ushbu litsenziya bo\'yicha siz: materiallarni o\'zgartirish yoki nusxalash; materiallardan har qanday tijorat maqsadlarida yoki ommaviy namoyish qilish uchun (tijorat yoki notijorat) foydalanish; Oson Apteka tarkibidagi har qanday dasturiy ta\'minotni kompilyatsiya qilishga yoki teskari muhandislik qilishga urinish; materiallardan mualliflik huquqi yoki boshqa mulkiy belgilarni olib tashlash; yoki materiallarni boshqa shaxsga o\'tkazish yoki boshqa serverda materiallarni \"ko\'zgu\" qilish. Agar siz ushbu cheklovlardan birini buzsangiz, ushbu litsenziya avtomatik ravishda tugatiladi va Oson Apteka tomonidan istalgan vaqtda bekor qilinishi mumkin. Ushbu materiallarni ko\'rishni to\'xtatgandan so\'ng yoki ushbu litsenziya tugatilgandan so\'ng, siz elektron yoki bosma formatda bo\'lgan har qanday yuklab olingan materiallarni yo\'q qilishingiz kerak.', '2022-08-29 15:51:19', '2022-08-29 15:51:19');
INSERT INTO `translations` VALUES (1069, 'privacies', 'title', 1, 'uz', 'Maxfiylik siyosati', '2022-08-29 15:52:05', '2022-08-29 15:52:05');
INSERT INTO `translations` VALUES (1070, 'privacies', 'text', 1, 'uz', 'Sizning maxfiyligingiz biz uchun muhim. Oson Apteka ilovamiz orqali sizdan toʻplashimiz mumkin boʻlgan har qanday maʼlumotlarga nisbatan shaxsiy daxlsizligingizni hurmat qilish Oson Apteka siyosatidir. Biz shaxsiy ma\'lumotni sizga xizmat ko\'rsatish uchun haqiqatan ham kerak bo\'lgandagina so\'raymiz. Biz uni sizning bilimingiz va roziligingiz bilan adolatli va qonuniy yo\'llar bilan yig\'amiz. Shuningdek, biz uni nima uchun to\'playotganimiz va undan qanday foydalanishimiz haqida xabar beramiz. Biz to\'plangan ma\'lumotlarni faqat siz so\'ragan xizmatni taqdim etish uchun zarur bo\'lgan vaqt davomida saqlaymiz. Qaysi ma\'lumotlarni saqlasak, yo\'qotish va o\'g\'irlik, shuningdek, ruxsatsiz kirish, oshkor qilish, nusxalash, foydalanish yoki o\'zgartirishning oldini olish uchun tijorat nuqtai nazaridan maqbul vositalar bilan himoya qilamiz. Qonunda talab qilingan hollar bundan mustasno, biz shaxsiy maʼlumotlarni ochiq yoki uchinchi shaxslar bilan baham koʻrmaymiz. Bizning ilovamiz biz ishlatmaydigan tashqi saytlarga havola qilishi mumkin. Iltimos, shuni yodda tutingki, biz ushbu saytlarning mazmuni va amaliyotlarini nazorat qila olmaymiz va ularning tegishli maxfiylik siyosati uchun javobgarlik yoki javobgarlikni o\'z zimmamizga olmaymiz. Sizga ba\'zi kerakli xizmatlarni taqdim eta olmasligimizni tushunib, shaxsiy ma\'lumotlaringizga bo\'lgan so\'rovimizni rad etishingiz mumkin. Ilovamizdan doimiy foydalanishingiz bizning maxfiylik va shaxsiy maʼlumotlarga oid amaliyotlarimizni qabul qilganlik sifatida qabul qilinadi. Agar sizda foydalanuvchi ma\'lumotlari va shaxsiy ma\'lumotlar bilan qanday ishlashimiz haqida savollaringiz bo\'lsa, biz bilan bog\'laning. Ushbu siyosat 2020-yil 6-avgustdan kuchga kiradi.', '2022-08-29 15:52:05', '2022-08-29 15:52:05');
